import moment from "moment";
export const calendrier = [
    // {
    //     start: moment("2024-06-13T16:00:00").toDate(),
    //     end: moment("2024-06-13T16:30:00").toDate(),
    //     title: "Cours React",
    // },
    {
        title: 'Meeting',
        start: new Date(2024, 5, 13, 10, 0), // Année, Mois (0-indexed), Jour, Heure, Minute
        end: new Date(2024, 5, 13, 12, 0),   // Année, Mois (0-indexed), Jour, Heure, Minute
    },
    {
        title: 'Lunch Break',
        start: new Date(2024, 5, 13, 12, 0),
        end: new Date(2024, 5, 13, 13, 0),
    },
]
